import React from 'react'
import Marker from './Marker';

const Makers = ({makers}) => {
    return (
        <div>
            <center><h1>Contact List</h1></center>
            {makers.map((maker) => 
             <Marker
             text={maker.address}
             lat={maker.latitude}
             lng={maker.longitude}
             />
            )}
        </div>
    )
};

export default Makers
